new BackupCollectListener(){
  @Nullable private SettingsItem getRestoreItem(  @NonNull List<SettingsItem> items,  @NonNull RemoteFile remoteFile){
    for (    SettingsItem item : items) {
      if (BackupHelper.applyItem(item,remoteFile.getType(),remoteFile.getName())) {
        return item;
      }
    }
    return null;
  }
  @Override public void onBackupCollectFinished(  boolean succeed,  boolean empty,  @NonNull List<SettingsItem> items,  @NonNull List<RemoteFile> remoteFiles){
