        PrepareBackupResult backup=app.getBackupHelper().getBackup();
        BackupInfo info=backup.getBackupInfo();
        Set<SettingsItem> itemsForRestore=new HashSet<>();
        if (info != null) {
          for (          RemoteFile remoteFile : info.filesToDownload) {
            SettingsItem restoreItem=getRestoreItem(items,remoteFile);
            if (restoreItem != null) {
              itemsForRestore.add(restoreItem);
            }
          }
        }
        setSettingsItems(new ArrayList<>(itemsForRestore));
        dataList=SettingsHelper.getSettingsToOperateByCategory(settingsItems,false,false);
        adapter.updateSettingsItems(dataList,selectedItemsMap);
      }
    }
  }
}

new AbstractProgress(){
  private int work=0;
  private int progress=0;
  private int deltaProgress=0;
  @Override public void startWork(  int work){
    if (listener != null) {
      this.work=work > 0 ? work : 1;
      listener.onFileDownloadStarted(type,fileName,work);
    }
  }
  @Override public void progress(  int deltaWork){
    if (listener != null) {
      deltaProgress+=deltaWork;
      if ((deltaProgress > (work / 100)) || ((progress + deltaProgress) >= work)) {
        progress+=deltaProgress;
        listener.onFileDownloadProgress(type,fileName,progress,deltaProgress);
        deltaProgress=0;
      }
    }
  }
  @Override public boolean isInterrupted(){
    if (listener != null) {
      return listener.isDownloadCancelled();
    }
    return super.isInterrupted();
  }
}

